import {React , Component } from 'react';

class T extends Component {
    
    render(){
        
         this.team = 
            [{name: "rabee" , image : "f" , job : "ux"},
             {name: "islam" , image : "s" , job : "ui"}
            ]  
        

        return(
            
            <section cl>
                {
                    this.team.map((member)=>{
                        return <div>
                            <h2>${member.name}</h2>
                            <div>${member.job}</div>
                        </div>
                    })
                }
            </section>
        )    
    }
}

export default T ;
